import Header from "../Global-components/Header";
// import Main from "../Global-components/Main";
import Footer from "../Global-components/Footer";

const Layout = ({ children }) => {
	return (
		<>
			<Header />
			{children}
			<Footer />
		</>
	);
};

export default Layout;
